using Consist.Doxi.Domain.Models;
using Consist.Doxi.Domain.Models.ExternalAPI;
using Consist.Doxi.Enums;
using Flurl;
using Microsoft.Extensions.Configuration;
using NUnit.Framework;
using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Reflection.PortableExecutable;
using System.Threading.Tasks;

namespace Doxi.APIClient.Tests
{
    public class DocumentTests
    {
        private IDoxiClient _doxiClient;
        [SetUp]
        public void Setup()
        {
            var builder = new ConfigurationBuilder()
                .AddUserSecrets<FlowsTests>();

            var configuration = builder.Build();

            _doxiClient = new DoxiClient(
                configuration["idpUrl"],
                configuration["serviceUrl"],
                configuration["CompanyName"],
                configuration["UserName"],
                configuration["Password"]);
        }
        [Test]
        public async Task DocumentInfo()
        {
            var pdfFile = File.ReadAllBytes(Path.Combine(Directory.GetCurrentDirectory(), "emptyPDF.pdf"));
            var result = await _doxiClient.DocumentInfo(pdfFile);
        }

        [Test]
        public async Task DocumentInfoBase64()
        {
            var result = await _doxiClient.DocumentInfoBase64(new GetDocumentInfoRquest
            {
                File = ""
            });
        }

        [Test]
        public async Task SearchInDocumentBase64()
        {
            var result = await _doxiClient.SearchInDocumentBase64(new SearchInDocumentBase64Request
            {
                Base64DocumentFile = "",
                SearchString = "שלום",
                Pages = "1",
                IsCaseSensitive = false
            });
        }

        [Test]
        public async Task SearchInDocument()
        {
            var pdfFile = File.ReadAllBytes(Path.Combine(Directory.GetCurrentDirectory(), "emptyPDF.pdf"));
            var result = await _doxiClient.SearchInDocument(pdfFile, new SearchInDocumentRequest
            {
                SearchString = "",
                Pages = "1",
                IsCaseSensitive = false,
            });
        }

        [Test]
        public async Task MergeDocuments()
        {
            var pdfFile = File.ReadAllBytes(Path.Combine(Directory.GetCurrentDirectory(), "emptyPDF.pdf"));
            var result = await _doxiClient.MergeDocuments(new byte[][] { pdfFile, pdfFile });
        }

    }
}

